import './App.css';
import {useTranslation } from "react-i18next";
import Login from './pages/Login';
import { Route, Routes } from 'react-router-dom';



function App() {
  const { t } = useTranslation();

  return (
    <div className="App">   
    <Routes>
      <Route path='/login' element={<Login/>}></Route>      
      </Routes>  
  </div>
  );
}

export default App;
